import React, { Component } from 'react';

class FooterComponent extends Component {
    render() {
        return (
            <footer id="footer">
                <div className="container">
                    <div className="gap">
                        <div className="wrap">
                            <div className="content">
                                    
                            </div>
                        </div>  
                    </div>
                </div>        
            </footer>
        );
    }
}

export default FooterComponent;
